    useEffect(() => {
        axios.get("http://140.116.214.154:3000/api/data/superUser")
        .then((res) => {
            setSuperUser(res.data[0].superUser)
        }).catch((res) => {

        })
    }, [])

    return (
        <>
            { superUser === 1 ? <MeetingDataUploadComp /> : <></> }
        </>
    );
}

export default Industry_analysisComp;
